import React from 'react'

const Navigation = ({ onRouteChange, isSignedIn }) => {
    if (isSignedIn) {
        return(
            <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
                <p onClick={() => onRouteChange('signin')} className='f3 link dim black underline pointer'> Sing Out</p>
            </nav>
        );
    }
    else {
        return (
        <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
        <p onClick={() => onRouteChange('signin')} className='f3 link dim black underline pointer'> Sing In</p>
        <p onClick={() => onRouteChange('signin')} className='f3 link dim black underline pointer'> Register</p>
        </nav>
        );
    }
}

export default Navigation;
